export default {
  "title": "Redis Developer Hub",
  "tagline": "The Home of Redis Developers",
  "url": "https://developer.redis.com",
  "baseUrl": "/",
  "onBrokenLinks": "throw",
  "onBrokenMarkdownLinks": "warn",
  "favicon": "img/favicon.ico",
  "organizationName": "redis-developer",
  "projectName": "redis-developer",
  "themeConfig": {
    "googleTagManager": {
      "trackingID": "GTM-W8Z6BLQ"
    },
    "prism": {
      "additionalLanguages": [
        "csharp",
        "php",
        "ruby"
      ]
    },
    "navbar": {
      "style": "dark",
      "title": null,
      "logo": {
        "alt": "Redis Developer Hub logo",
        "src": "img/logo-1.png"
      },
      "hideOnScroll": false,
      "items": [
        {
          "to": "/create/rediscloud",
          "activeBasePath": "docs",
          "label": "Get started",
          "position": "right"
        },
        {
          "href": "https://redis.com/try-free/",
          "label": "Try Free",
          "position": "right"
        }
      ]
    },
    "footer": {
      "style": "dark",
      "logo": {
        "alt": "Redis Labs logo",
        "src": "img/redis_logo_red_white_rgb.svg",
        "href": "https://redis.com/"
      },
      "links": [
        {
          "title": "Get Started",
          "items": [
            {
              "label": "Create Database",
              "to": "/create/rediscloud"
            },
            {
              "label": "Develop",
              "to": "/develop/"
            },
            {
              "label": "Explore your data",
              "to": "/explore/redisinsight/"
            },
            {
              "label": "Best Practices",
              "href": "https://redis.com/redis-best-practices/introduction/"
            },
            {
              "label": "Build with Redis Modules",
              "href": "/howtos/redisearch/"
            }
          ]
        },
        {
          "title": "Resources",
          "items": [
            {
              "label": "Community",
              "href": "https://redis.com/community/"
            },
            {
              "label": "Redis University",
              "href": "https://university.redis.com"
            },
            {
              "label": "Command Reference",
              "href": "https://redis.io/commands"
            },
            {
              "label": "How-tos & tutorials",
              "to": "/howtos"
            }
          ]
        }
      ],
      "copyright": "Copyright: Â© 2021 Redis. All rights reserved. Redis and the cube logo are registered trademarks of Redis Ltd."
    },
    "colorMode": {
      "disableSwitch": false,
      "defaultMode": "light",
      "respectPrefersColorScheme": false,
      "switchConfig": {
        "darkIcon": "ðŸŒœ",
        "darkIconStyle": {},
        "lightIcon": "ðŸŒž",
        "lightIconStyle": {}
      }
    },
    "announcementBar": {
      "id": "redisconf20201cfp",
      "content": "<p class=\"text\">Watch all RedisConf sessions on Demand </p> <a href=\"https://www.youtube.com/c/Redisinc/playlists?view=50&sort=dd&shelf_id=1\" target=\"_blank\" rel=\"noopener\" class=\"btn\">Watch Now!</a>",
      "backgroundColor": "#fff",
      "textColor": "#000",
      "isCloseable": true
    },
    "docs": {
      "versionPersistence": "localStorage"
    },
    "metadatas": [],
    "hideableSidebar": false
  },
  "presets": [
    [
      "@docusaurus/preset-classic",
      {
        "docs": {
          "routeBasePath": "/",
          "path": "docs",
          "sidebarPath": "/Users/ajeetraina/projects/8sep/redis-developer.github.io/sidebars.js",
          "editUrl": "https://github.com/redis-developer/redis-developer/edit/master/"
        },
        "blog": {
          "showReadingTime": true
        },
        "theme": {
          "customCss": "/Users/ajeetraina/projects/8sep/redis-developer.github.io/src/css/custom.scss"
        }
      }
    ]
  ],
  "plugins": [
    "docusaurus-plugin-sass",
    "/Users/ajeetraina/projects/8sep/redis-developer.github.io/plugins/gtm"
  ],
  "baseUrlIssueBanner": true,
  "i18n": {
    "defaultLocale": "en",
    "locales": [
      "en"
    ],
    "localeConfigs": {}
  },
  "onDuplicateRoutes": "warn",
  "customFields": {},
  "themes": [],
  "titleDelimiter": "|",
  "noIndex": false
};
